import React from 'react';
import uuid from 'uuid';
import { useQuery, useMutation, useSubscription } from "@apollo/react-hooks";
import queries from 'queries/Empresas.jsx';
import { gql } from 'apollo-boost'
import get from 'lodash.get';

const getEmpresas = gql`${queries.getEmpresas}`;

// const empresaitem=()=>(

//   <tbody>
//     <item />
//   </tbody>

// )

function item(){

  const { data, error, loading } = useQuery(getEmpresas);

  // const datos= this.props.variables;


  if (loading) {
    return <div>Loading...</div>;
  };
  if (error) {
    return <div>Error! {error.message}</div>;
  };

  return (
    <tbody>
      {get(data.empresas.map(element => (
        <tr key={uuid()}>
          <th key={get(element._id)} className="text-right">
            {get(element.nombre)}
          </th>

          <th key={get(element._id)} className="text-right">
            {get(element.correo)}
          </th>

          <th key={get(element._id)} className="text-right">
            {get(element.canton)}
          </th>

          <th key={get(element._id)} className="text-right">
            {get(element.provincia)}
          </th>
        </tr>
      )))}
    </tbody>
  )
};

export default item;
